        DB::statement("INSERT INTO tblemailtemplates VALUES(1, 'client', 'new-client-created', 'english', 'New Contact Added/Registered (Welcome Email)', 'Welcome aboard', 'Dear {contact_firstname} {contact_lastname}<br /><br />Thank you for registering on the <strong>{companyname}</strong> CRM System.<br /><br />We just wanted to say welcome.<br /><br />Please contact us if you need any help.<br /><br />Click here to view your profile: <a href=\'{crm_url}\'>{crm_url}</a><br /><br />Kind Regards, <br />{email_signature}<br /><br />(This is an automated email, so please don\'t reply to this email address)', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (2, 'invoice', 'invoice-send-to-client', 'english', 'Send Invoice to Customer', 'Invoice with number {invoice_number} created', '<span style=\'font-size: 12pt;\'>Dear {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>We have prepared the following invoice for you: <strong> {invoice_number}</strong></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Invoice status</strong>: {invoice_status}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the invoice on the following link: <a href=\'{invoice_link}\'>{invoice_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Please contact us for more information.</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (3, 'ticket', 'new-ticket-opened-admin', 'english', 'New Ticket Opened (Opened by Staff, Sent to Customer)', 'New Support Ticket Opened', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>New support ticket has been opened.</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject:</strong> {ticket_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Department:</strong> {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority:</strong> {ticket_priority}<br /></span><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_public_url}\'>{ticket_id}</a><br /><br />Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (4, 'ticket', 'ticket-reply', 'english', 'Ticket Reply (Sent to Customer)', 'New Ticket Reply', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>You have a new ticket reply to ticket <a href=\'{ticket_public_url}\'>{ticket_id}</a></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Ticket Subject:</strong> {ticket_subject}<br /></span><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_public_url}\'>{ticket_id}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (5, 'ticket', 'ticket-autoresponse', 'english', 'New Ticket Opened - Autoresponse', 'New Support Ticket Opened', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>Thank you for contacting our support team. A support ticket has now been opened for your request. You will be notified when a response is made by email.</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject:</strong> {ticket_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Department</strong>: {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority:</strong> {ticket_priority}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_public_url}\'>{ticket_id}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (6, 'invoice', 'invoice-payment-recorded', 'english', 'Invoice Payment Recorded (Sent to Customer)', 'Invoice Payment Recorded', '<span style=\'font-size: 12pt;\'>Hello {contact_firstname}&nbsp;{contact_lastname}<br /><br /></span>Thank you for the payment. Find the payment details below:<br /><br /> <br /><br />Amount:&nbsp;<strong>{payment_total}<br /></strong>Date:&nbsp;<strong>{payment_date}</strong><br />Invoice number:&nbsp;<span style=\'font-size: 12pt;\'><strong> {invoice_number}<br /><br /></strong></span> <br /><br />You can always view the invoice for this payment at the following link:&nbsp;<a href=\'{invoice_link}\'><span style=\'font-size: 12pt;\'>{invoice_number}</span></a><br /><br />We are looking forward working with you.<br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (7, 'invoice', 'invoice-overdue-notice', 'english', 'Invoice Overdue Notice', 'Invoice Overdue Notice - {invoice_number}', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>This is an overdue notice for invoice <strong> {invoice_number}</strong></span><br /><br /><span style=\'font-size: 12pt;\'>This invoice was due: {invoice_duedate}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the invoice on the following link: <a href=\'{invoice_link}\'>{invoice_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (8, 'invoice', 'invoice-already-send', 'english', 'Invoice Already Sent to Customer', 'Invoice  {invoice_number} ', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>At your request, here is the invoice with number <strong> {invoice_number}</strong></span><br /><br /><span style=\'font-size: 12pt;\'>You can view the invoice on the following link: <a href=\'{invoice_link}\'>{invoice_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Please contact us for more information.</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (9, 'ticket', 'new-ticket-created-staff', 'english', 'New Ticket Created (Opened by Customer, Sent to Staff Members)', 'New Ticket Created', '<p><span style=\'font-size: 12pt;\'>A new support ticket has been opened.</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject</strong>: {ticket_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Department</strong>: {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority</strong>: {ticket_priority}<br /></span><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_url}\'>{ticket_id}</a></span><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (10, 'estimate', 'estimate-send-to-client', 'english', 'Send Estimate to Customer', 'Estimate  {estimate_number} created', '<span style=\'font-size: 12pt;\'>Dear {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>Please find the attached estimate <strong> {estimate_number}</strong></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Estimate status:</strong> {estimate_status}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the estimate on the following link: <a href=\'{estimate_link}\'>{estimate_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>We look forward to your communication.</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}<br /></span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (11, 'ticket', 'ticket-reply-to-admin', 'english', 'Ticket Reply (Sent to Staff)', 'New Support Ticket Reply', '<span style=\'font-size: 12pt;\'>A new support ticket reply from {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject</strong>: {ticket_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Department</strong>: {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority</strong>: {ticket_priority}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_url}\'>{ticket_id}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (12, 'estimate', 'estimate-already-send', 'english', 'Estimate Already Sent to Customer', 'Estimate  {estimate_number} ', '<span style=\'font-size: 12pt;\'>Dear {contact_firstname} {contact_lastname}</span><br /> <br /><span style=\'font-size: 12pt;\'>Thank you for your estimate request.</span><br /> <br /><span style=\'font-size: 12pt;\'>You can view the estimate on the following link: <a href=\'{estimate_link}\'>{estimate_number}</a></span><br /> <br /><span style=\'font-size: 12pt;\'>Please contact us for more information.</span><br /> <br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (13, 'contract', 'contract-expiration', 'english', 'Contract Expiration Reminder (Sent to Customer Contacts)', 'Contract Expiration Reminder', '<span style=\'font-size: 12pt;\'>Dear {client_company}</span><br /><br /><span style=\'font-size: 12pt;\'>This is a reminder that the following contract will expire soon:</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject:</strong> {contract_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Description:</strong> {contract_description}</span><br /><span style=\'font-size: 12pt;\'><strong>Date Start:</strong> {contract_datestart}</span><br /><span style=\'font-size: 12pt;\'><strong>Date End:</strong> {contract_dateend}</span><br /><br /><span style=\'font-size: 12pt;\'>Please contact us for more information.</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (14, 'tasks', 'task-assigned', 'english', 'New Task Assigned (Sent to Staff)', 'New Task Assigned to You - {task_name}', '<span style=\'font-size: 12pt;\'>Dear {staff_firstname}</span><br /><br /><span style=\'font-size: 12pt;\'>You have been assigned to a new task:</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Name:</strong> {task_name}<br /></span><strong>Start Date:</strong> {task_startdate}<br /><span style=\'font-size: 12pt;\'><strong>Due date:</strong> {task_duedate}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority:</strong> {task_priority}<br /><br /></span><span style=\'font-size: 12pt;\'><span>You can view the task on the following link</span>: <a href=\'{task_link}\'>{task_name}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (15, 'tasks', 'task-added-as-follower', 'english', 'Staff Member Added as Follower on Task (Sent to Staff)', 'You are added as follower on task - {task_name}', '<span style=\'font-size: 12pt;\'>Hi {staff_firstname}<br /></span><br /><span style=\'font-size: 12pt;\'>You have been added as follower on the following task:</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Name:</strong> {task_name}</span><br /><span style=\'font-size: 12pt;\'><strong>Start date:</strong> {task_startdate}</span><br /><br /><span>You can view the task on the following link</span><span>: </span><a href=\'{task_link}\'>{task_name}</a><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (16, 'tasks', 'task-commented', 'english', 'New Comment on Task (Sent to Staff)', 'New Comment on Task - {task_name}', 'Dear {staff_firstname}<br /><br />A comment has been made on the following task:<br /><br /><strong>Name:</strong> {task_name}<br /><strong>Comment:</strong> {task_comment}<br /><br />You can view the task on the following link: <a href=\'{task_link}\'>{task_name}</a><br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (17, 'tasks', 'task-added-attachment', 'english', 'New Attachment(s) on Task (Sent to Staff)', 'New Attachment on Task - {task_name}', 'Hi {staff_firstname}<br /><br /><strong>{task_user_take_action}</strong> added an attachment on the following task:<br /><br /><strong>Name:</strong> {task_name}<br /><br />You can view the task on the following link: <a href=\'{task_link}\'>{task_name}</a><br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (18, 'estimate', 'estimate-declined-to-staff', 'english', 'Estimate Declined (Sent to Staff)', 'Customer Declined Estimate', '<span style=\'font-size: 12pt;\'>Hi</span><br /> <br /><span style=\'font-size: 12pt;\'>Customer ({client_company}) declined estimate with number <strong> {estimate_number}</strong></span><br /> <br /><span style=\'font-size: 12pt;\'>You can view the estimate on the following link: <a href=\'{estimate_link}\'>{estimate_number}</a></span><br /> <br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (19, 'estimate', 'estimate-accepted-to-staff', 'english', 'Estimate Accepted (Sent to Staff)', 'Customer Accepted Estimate', '<span style=\'font-size: 12pt;\'>Hi</span><br /> <br /><span style=\'font-size: 12pt;\'>Customer ({client_company}) accepted estimate with number <strong> {estimate_number}</strong></span><br /> <br /><span style=\'font-size: 12pt;\'>You can view the estimate on the following link: <a href=\'{estimate_link}\'>{estimate_number}</a></span><br /> <br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (20, 'proposals', 'proposal-client-accepted', 'english', 'Customer Action - Accepted (Sent to Staff)', 'Customer Accepted Proposal', '<div>Hi<br /> <br />Client <strong>{proposal_proposal_to}</strong> accepted the following proposal:<br /> <br /><strong>Number:</strong> {proposal_number}<br /><strong>Subject</strong>: {proposal_subject}<br /><strong>Total</strong>: {proposal_total}<br /> <br />View the proposal on the following link: <a href=\'{proposal_link}\'>{proposal_number}</a><br /> <br />Kind Regards,<br />{email_signature}</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (21, 'proposals', 'proposal-send-to-customer', 'english', 'Send Proposal to Customer', 'Proposal With Number {proposal_number} Created', 'Dear {proposal_proposal_to}<br /><br />Please find our attached proposal.<br /><br />This proposal is valid until: {proposal_open_till}<br />You can view the proposal on the following link: <a href=\'{proposal_link}\'>{proposal_number}</a><br /><br />Please don\'t hesitate to comment online if you have any questions.<br /><br />We look forward to your communication.<br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (22, 'proposals', 'proposal-client-declined', 'english', 'Customer Action - Declined (Sent to Staff)', 'Client Declined Proposal', 'Hi<br /> <br />Customer <strong>{proposal_proposal_to}</strong> declined the proposal <strong>{proposal_subject}</strong><br /> <br />View the proposal on the following link <a href=\'{proposal_link}\'>{proposal_number}</a>&nbsp;or from the admin area.<br /> <br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (23, 'proposals', 'proposal-client-thank-you', 'english', 'Thank You Email (Sent to Customer After Accept)', 'Thank for you accepting proposal', 'Dear {proposal_proposal_to}<br /> <br />Thank for for accepting the proposal.<br /> <br />We look forward to doing business with you.<br /> <br />We will contact you as soon as possible<br /> <br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (24, 'proposals', 'proposal-comment-to-client', 'english', 'New Comment  (Sent to Customer/Lead)', 'New Proposal Comment', 'Dear {proposal_proposal_to}<br /> <br />A new comment has been made on the following proposal: <strong>{proposal_number}</strong><br /> <br />You can view and reply to the comment on the following link: <a href=\'{proposal_link}\'>{proposal_number}</a><br /> <br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (25, 'proposals', 'proposal-comment-to-admin', 'english', 'New Comment (Sent to Staff) ', 'New Proposal Comment', 'Hi<br /> <br />A new comment has been made to the proposal <strong>{proposal_subject}</strong><br /> <br />You can view and reply to the comment on the following link: <a href=\'{proposal_link}\'>{proposal_number}</a>&nbsp;or from the admin area.<br /> <br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (26, 'estimate', 'estimate-thank-you-to-customer', 'english', 'Thank You Email (Sent to Customer After Accept)', 'Thank for you accepting estimate', '<span style=\'font-size: 12pt;\'>Dear {contact_firstname} {contact_lastname}</span><br /> <br /><span style=\'font-size: 12pt;\'>Thank for for accepting the estimate.</span><br /> <br /><span style=\'font-size: 12pt;\'>We look forward to doing business with you.</span><br /> <br /><span style=\'font-size: 12pt;\'>We will contact you as soon as possible.</span><br /> <br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (27, 'tasks', 'task-deadline-notification', 'english', 'Task Deadline Reminder - Sent to Assigned Members', 'Task Deadline Reminder', 'Hi {staff_firstname}&nbsp;{staff_lastname}<br /><br />This is an automated email from {companyname}.<br /><br />The task <strong>{task_name}</strong> deadline is on <strong>{task_duedate}</strong>. <br />This task is still not finished.<br /><br />You can view the task on the following link: <a href=\'{task_link}\'>{task_name}</a><br /><br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (28, 'contract', 'send-contract', 'english', 'Send Contract to Customer', 'Contract - {contract_subject}', '<p><span style=\'font-size: 12pt;\'>Hi&nbsp;{contact_firstname}&nbsp;{contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>Please find the <a href=\'{contract_link}\'>{contract_subject}</a> attached.<br /><br />Description: {contract_description}<br /><br /></span><span style=\'font-size: 12pt;\'>Looking forward to hear from you.</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (29, 'invoice', 'invoice-payment-recorded-to-staff', 'english', 'Invoice Payment Recorded (Sent to Staff)', 'New Invoice Payment', '<span style=\'font-size: 12pt;\'>Hi</span><br /><br /><span style=\'font-size: 12pt;\'>Customer recorded payment for invoice <strong> {invoice_number}</strong></span><br /> <br /><span style=\'font-size: 12pt;\'>You can view the invoice on the following link: <a href=\'{invoice_link}\'>{invoice_number}</a></span><br /> <br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (30, 'ticket', 'auto-close-ticket', 'english', 'Auto Close Ticket', 'Ticket Auto Closed', '<p><span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>Ticket {ticket_subject} has been auto close due to inactivity.</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Ticket </strong>: <a href=\'{ticket_public_url}\'>{ticket_id}</a></span><br /><span style=\'font-size: 12pt;\'><strong>Department</strong>: {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority:</strong> {ticket_priority}</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (31, 'project', 'new-project-discussion-created-to-staff', 'english', 'New Project Discussion (Sent to Project Members)', 'New Project Discussion Created - {project_name}', '<p>Hi {staff_firstname}<br /><br />New project discussion created from <strong>{discussion_creator}</strong><br /><br /><strong>Subject:</strong> {discussion_subject}<br /><strong>Description:</strong> {discussion_description}<br /><br />You can view the discussion on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (32, 'project', 'new-project-discussion-created-to-customer', 'english', 'New Project Discussion (Sent to Customer Contacts)', 'New Project Discussion Created - {project_name}', '<p>Hello {contact_firstname} {contact_lastname}<br /><br />New project discussion created from <strong>{discussion_creator}</strong><br /><br /><strong>Subject:</strong> {discussion_subject}<br /><strong>Description:</strong> {discussion_description}<br /><br />You can view the discussion on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (33, 'project', 'new-project-file-uploaded-to-customer', 'english', 'New Project File(s) Uploaded (Sent to Customer Contacts)', 'New Project File(s) Uploaded - {project_name}', '<p>Hello {contact_firstname} {contact_lastname}<br /><br />New project file is uploaded on <strong>{project_name}</strong> from <strong>{file_creator}</strong><br /><br />You can view the project on the following link: <a href=\'{project_link}\'>{project_name}</a><br /><br />To view the file in our CRM you can click on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (34, 'project', 'new-project-file-uploaded-to-staff', 'english', 'New Project File(s) Uploaded (Sent to Project Members)', 'New Project File(s) Uploaded - {project_name}', '<p>Hello&nbsp;{staff_firstname}</p>\r\n<p>New project&nbsp;file is uploaded on&nbsp;<strong>{project_name}</strong> from&nbsp;<strong>{file_creator}</strong></p>\r\n<p>You can view the project on the following link: <a href=\'{project_link}\'>{project_name}<br /></a><br />To view&nbsp;the file you can click on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a></p>\r\n<p>Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (35, 'project', 'new-project-discussion-comment-to-customer', 'english', 'New Discussion Comment  (Sent to Customer Contacts)', 'New Discussion Comment', '<p><span style=\'font-size: 12pt;\'>Hello {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>New discussion comment has been made on <strong>{discussion_subject}</strong> from <strong>{comment_creator}</strong></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Discussion subject:</strong> {discussion_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Comment</strong>: {discussion_comment}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the discussion on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (36, 'project', 'new-project-discussion-comment-to-staff', 'english', 'New Discussion Comment (Sent to Project Members)', 'New Discussion Comment', '<p>Hi {staff_firstname}<br /><br />New discussion comment has been made on <strong>{discussion_subject}</strong> from <strong>{comment_creator}</strong><br /><br /><strong>Discussion subject:</strong> {discussion_subject}<br /><strong>Comment:</strong> {discussion_comment}<br /><br />You can view the discussion on the following link: <a href=\'{discussion_link}\'>{discussion_subject}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (37, 'project', 'staff-added-as-project-member', 'english', 'Staff Added as Project Member', 'New project assigned to you', '<p>Hi {staff_firstname}<br /><br />New project has been assigned to you.<br /><br />You can view the project on the following link <a href=\'{project_link}\'>{project_name}</a><br /><br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (38, 'estimate', 'estimate-expiry-reminder', 'english', 'Estimate Expiration Reminder', 'Estimate Expiration Reminder', '<p><span style=\'font-size: 12pt;\'>Hello {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'>The estimate with <strong> {estimate_number}</strong> will expire on <strong>{estimate_expirydate}</strong></span><br /><br /><span style=\'font-size: 12pt;\'>You can view the estimate on the following link: <a href=\'{estimate_link}\'>{estimate_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (39, 'proposals', 'proposal-expiry-reminder', 'english', 'Proposal Expiration Reminder', 'Proposal Expiration Reminder', '<p>Hello {proposal_proposal_to}<br /><br />The proposal {proposal_number}&nbsp;will expire on <strong>{proposal_open_till}</strong><br /><br />You can view the proposal on the following link: <a href=\'{proposal_link}\'>{proposal_number}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (40, 'staff', 'new-staff-created', 'english', 'New Staff Created (Welcome Email)', 'You are added as staff member', 'Hi {staff_firstname}<br /><br />You are added as member on our CRM.<br /><br />Please use the following logic credentials:<br /><br /><strong>Email:</strong> {staff_email}<br /><strong>Password:</strong> {password}<br /><br />Click <a href=\'{admin_url}\'>here </a>to login in the dashboard.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (41, 'client', 'contact-forgot-password', 'english', 'Forgot Password', 'Create New Password', '<h2>Create a new password</h2>\r\nForgot your password?<br /> To create a new password, just follow this link:<br /> <br /><a href=\'{reset_password_url}\'>Reset Password</a><br /> <br /> You received this email, because it was requested by a {companyname}&nbsp;user. This is part of the procedure to create a new password on the system. If you DID NOT request a new password then please ignore this email and your password will remain the same. <br /><br /> {email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (42, 'client', 'contact-password-reseted', 'english', 'Password Reset - Confirmation', 'Your password has been changed', '<strong><span style=\'font-size: 14pt;\'>You have changed your password.</span><br /></strong><br /> Please, keep it in your records so you don\'t forget it.<br /> <br /> Your email address for login is: {contact_email}<br /><br />If this wasnt you, please contact us.<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (43, 'client', 'contact-set-password', 'english', 'Set New Password', 'Set new password on {companyname} ', '<h2><span style=\'font-size: 14pt;\'>Setup your new password on {companyname}</span></h2>\r\nPlease use the following link to set up your new password:<br /><br /><a href=\'{set_password_url}\'>Set new password</a><br /><br />Keep it in your records so you don\'t forget it.<br /><br />Please set your new password in <strong>48 hours</strong>. After that, you won\'t be able to set your password because this link will expire.<br /><br />You can login at: <a href=\'{crm_url}\'>{crm_url}</a><br />Your email address for login: {contact_email}<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (44, 'staff', 'staff-forgot-password', 'english', 'Forgot Password', 'Create New Password', '<h2><span style=\'font-size: 14pt;\'>Create a new password</span></h2>\r\nForgot your password?<br /> To create a new password, just follow this link:<br /> <br /><a href=\'{reset_password_url}\'>Reset Password</a><br /> <br /> You received this email, because it was requested by a <strong>{companyname}</strong>&nbsp;user. This is part of the procedure to create a new password on the system. If you DID NOT request a new password then please ignore this email and your password will remain the same. <br /><br /> {email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (45, 'staff', 'staff-password-reseted', 'english', 'Password Reset - Confirmation', 'Your password has been changed', '<span style=\'font-size: 14pt;\'><strong>You have changed your password.<br /></strong></span><br /> Please, keep it in your records so you don\'t forget it.<br /> <br /> Your email address for login is: {staff_email}<br /><br /> If this wasnt you, please contact us.<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (46, 'project', 'assigned-to-project', 'english', 'New Project Created (Sent to Customer Contacts)', 'New Project Created', '<p>Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}</p>\r\n<p>New project is assigned to your company.<br /><br /><strong>Project Name:</strong>&nbsp;{project_name}<br /><strong>Project Start Date:</strong>&nbsp;{project_start_date}</p>\r\n<p>You can view the project on the following link:&nbsp;<a href=\'{project_link}\'>{project_name}</a></p>\r\n<p>We are looking forward hearing from you.<br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (47, 'tasks', 'task-added-attachment-to-contacts', 'english', 'New Attachment(s) on Task (Sent to Customer Contacts)', 'New Attachment on Task - {task_name}', '<span>Hi {contact_firstname} {contact_lastname}</span><br /><br /><strong>{task_user_take_action}</strong><span> added an attachment on the following task:</span><br /><br /><strong>Name:</strong><span> {task_name}</span><br /><br /><span>You can view the task on the following link: </span><a href=\'{task_link}\'>{task_name}</a><br /><br /><span>Kind Regards,</span><br /><span>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (48, 'tasks', 'task-commented-to-contacts', 'english', 'New Comment on Task (Sent to Customer Contacts)', 'New Comment on Task - {task_name}', '<span>Dear {contact_firstname} {contact_lastname}</span><br /><br /><span>A comment has been made on the following task:</span><br /><br /><strong>Name:</strong><span> {task_name}</span><br /><strong>Comment:</strong><span> {task_comment}</span><br /><br /><span>You can view the task on the following link: </span><a href=\'{task_link}\'>{task_name}</a><br /><br /><span>Kind Regards,</span><br /><span>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (49, 'leads', 'new-lead-assigned', 'english', 'New Lead Assigned to Staff Member', 'New lead assigned to you', '<p>Hello {lead_assigned}<br /><br />New lead is assigned to you.<br /><br /><strong>Lead Name:</strong>&nbsp;{lead_name}<br /><strong>Lead Email:</strong>&nbsp;{lead_email}<br /><br />You can view the lead on the following link: <a href=\'{lead_link}\'>{lead_name}</a><br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (50, 'client', 'client-statement', 'english', 'Statement - Account Summary', 'Account Statement from {statement_from} to {statement_to}', 'Dear {contact_firstname} {contact_lastname}, <br /><br />Its been a great experience working with you.<br /><br />Attached with this email is a list of all transactions for the period between {statement_from} to {statement_to}<br /><br />For your information your account balance due is total:&nbsp;{statement_balance_due}<br /><br />Please contact us if you need more information.<br /> <br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (51, 'ticket', 'ticket-assigned-to-admin', 'english', 'New Ticket Assigned (Sent to Staff)', 'New support ticket has been assigned to you', '<p><span style=\'font-size: 12pt;\'>Hi</span></p>\r\n<p><span style=\'font-size: 12pt;\'>A new support ticket&nbsp;has been assigned to you.</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject</strong>: {ticket_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Department</strong>: {ticket_department}</span><br /><span style=\'font-size: 12pt;\'><strong>Priority</strong>: {ticket_priority}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Ticket message:</strong></span><br /><span style=\'font-size: 12pt;\'>{ticket_message}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the ticket on the following link: <a href=\'{ticket_url}\'>{ticket_id}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (52, 'client', 'new-client-registered-to-admin', 'english', 'New Customer Registration (Sent to admins)', 'New Customer Registration', 'Hello.<br /><br />New customer registration on your customer portal:<br /><br /><strong>Firstname:</strong>&nbsp;{contact_firstname}<br /><strong>Lastname:</strong>&nbsp;{contact_lastname}<br /><strong>Company:</strong>&nbsp;{client_company}<br /><strong>Email:</strong>&nbsp;{contact_email}<br /><br />Best Regards', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (53, 'leads', 'new-web-to-lead-form-submitted', 'english', 'Web to lead form submitted - Sent to lead', '{lead_name} - We Received Your Request', 'Hello {lead_name}.<br /><br /><strong>Your request has been received.</strong><br /><br />This email is to let you know that we received your request and we will get back to you as soon as possible with more information.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 0, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (54, 'staff', 'two-factor-authentication', 'english', 'Two Factor Authentication', 'Confirm Your Login', '<p>Hi {staff_firstname}</p>\r\n<p style=\'text-align: left;\'>You received this email because you have enabled two factor authentication in your account.<br />Use the following code to confirm your login:</p>\r\n<p style=\'text-align: left;\'><span style=\'font-size: 18pt;\'><strong>{two_factor_auth_code}<br /><br /></strong><span style=\'font-size: 12pt;\'>{email_signature}</span><strong><br /><br /><br /><br /></strong></span></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (55, 'project', 'project-finished-to-customer', 'english', 'Project Marked as Finished (Sent to Customer Contacts)', 'Project Marked as Finished', '<p>Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}</p>\r\n<p>You are receiving this email because project&nbsp;<strong>{project_name}</strong> has been marked as finished. This project is assigned under your company and we just wanted to keep you up to date.<br /><br />You can view the project on the following link:&nbsp;<a href=\'{project_link}\'>{project_name}</a></p>\r\n<p>If you have any questions don\'t hesitate to contact us.<br /><br />Kind Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (56, 'credit_note', 'credit-note-send-to-client', 'english', 'Send Credit Note To Email', 'Credit Note With Number {credit_note_number} Created', 'Dear&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br />We have attached the credit note with number <strong>{credit_note_number} </strong>for your reference.<br /><br /><strong>Date:</strong>&nbsp;{credit_note_date}<br /><strong>Total Amount:</strong>&nbsp;{credit_note_total}<br /><br /><span style=\'font-size: 12pt;\'>Please contact us for more information.</span><br /> <br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (57, 'tasks', 'task-status-change-to-staff', 'english', 'Task Status Changed (Sent to Staff)', 'Task Status Changed', '<span style=\'font-size: 12pt;\'>Hi {staff_firstname}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>{task_user_take_action}</strong> marked task as <strong>{task_status}</strong></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Name:</strong> {task_name}</span><br /><span style=\'font-size: 12pt;\'><strong>Due date:</strong> {task_duedate}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the task on the following link: <a href=\'{task_link}\'>{task_name}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (58, 'tasks', 'task-status-change-to-contacts', 'english', 'Task Status Changed (Sent to Customer Contacts)', 'Task Status Changed', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}</span><br /><br /><span style=\'font-size: 12pt;\'><strong>{task_user_take_action}</strong> marked task as <strong>{task_status}</strong></span><br /><br /><span style=\'font-size: 12pt;\'><strong>Name:</strong> {task_name}</span><br /><span style=\'font-size: 12pt;\'><strong>Due date:</strong> {task_duedate}</span><br /><br /><span style=\'font-size: 12pt;\'>You can view the task on the following link: <a href=\'{task_link}\'>{task_name}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (59, 'staff', 'reminder-email-staff', 'english', 'Staff Reminder Email', 'You Have a New Reminder!', '<p>Hello&nbsp;{staff_firstname}<br /><br /><strong>You have a new reminder&nbsp;linked to&nbsp;{staff_reminder_relation_name}!<br /><br />Reminder description:</strong><br />{staff_reminder_description}<br /><br />Click <a href=\'{staff_reminder_relation_link}\'>here</a> to view&nbsp;<a href=\'{staff_reminder_relation_link}\'>{staff_reminder_relation_name}</a><br /><br />Best Regards<br /><br /></p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (60, 'contract', 'contract-comment-to-client', 'english', 'New Comment  (Sent to Customer Contacts)', 'New Contract Comment', 'Dear {contact_firstname} {contact_lastname}<br /> <br />A new comment has been made on the following contract: <strong>{contract_subject}</strong><br /> <br />You can view and reply to the comment on the following link: <a href=\'{contract_link}\'>{contract_subject}</a><br /> <br />Kind Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (61, 'contract', 'contract-comment-to-admin', 'english', 'New Comment (Sent to Staff) ', 'New Contract Comment', 'Hi {staff_firstname}<br /><br />A new comment has been made to the contract&nbsp;<strong>{contract_subject}</strong><br /><br />You can view and reply to the comment on the following link: <a href=\'{contract_link}\'>{contract_subject}</a>&nbsp;or from the admin area.<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (62, 'subscriptions', 'send-subscription', 'english', 'Send Subscription to Customer', 'Subscription Created', 'Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br />We have prepared the subscription&nbsp;<strong>{subscription_name}</strong> for your company.<br /><br />Click <a href=\'{subscription_link}\'>here</a> to review the subscription and subscribe.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (63, 'subscriptions', 'subscription-payment-failed', 'english', 'Subscription Payment Failed', 'Your most recent invoice payment failed', 'Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br br=\'\' />Unfortunately, your most recent invoice payment for&nbsp;<strong>{subscription_name}</strong> was declined.<br /><br />This could be due to a change in your card number, your card expiring,<br />cancellation of your credit card, or the card issuer not recognizing the<br />payment and therefore taking action to prevent it.<br /><br />Please update your payment information as soon as possible by logging in here:<br /><a href=\'{crm_url}/login\'>{crm_url}/login</a><br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (64, 'subscriptions', 'subscription-canceled', 'english', 'Subscription Canceled (Sent to customer primary contact)', 'Your subscription has been canceled', 'Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br />Your subscription&nbsp;<strong>{subscription_name} </strong>has been canceled, if you have any questions don\'t hesitate to contact us.<br /><br />It was a pleasure doing business with you.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (65, 'subscriptions', 'subscription-payment-succeeded', 'english', 'Subscription Payment Succeeded (Sent to customer primary contact)', 'Subscription  Payment Receipt - {subscription_name}', 'Hello&nbsp;{contact_firstname}&nbsp;{contact_lastname}<br /><br />This email is to let you know that we received your payment for subscription&nbsp;<strong>{subscription_name}&nbsp;</strong>of&nbsp;<strong><span>{payment_total}<br /><br /></span></strong>The invoice associated with it is now with status&nbsp;<strong>{invoice_status}<br /></strong><br />Thank you for your confidence.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (66, 'contract', 'contract-expiration-to-staff', 'english', 'Contract Expiration Reminder (Sent to Staff)', 'Contract Expiration Reminder', 'Hi {staff_firstname}<br /><br /><span style=\'font-size: 12pt;\'>This is a reminder that the following contract will expire soon:</span><br /><br /><span style=\'font-size: 12pt;\'><strong>Subject:</strong> {contract_subject}</span><br /><span style=\'font-size: 12pt;\'><strong>Description:</strong> {contract_description}</span><br /><span style=\'font-size: 12pt;\'><strong>Date Start:</strong> {contract_datestart}</span><br /><span style=\'font-size: 12pt;\'><strong>Date End:</strong> {contract_dateend}</span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (67, 'gdpr', 'gdpr-removal-request', 'english', 'Removal Request From Contact (Sent to administrators)', 'Data Removal Request Received', 'Hello&nbsp;{staff_firstname}&nbsp;{staff_lastname}<br /><br />Data removal has been requested by&nbsp;{contact_firstname} {contact_lastname}<br /><br />You can review this request and take proper actions directly from the admin area.', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (68, 'gdpr', 'gdpr-removal-request-lead', 'english', 'Removal Request From Lead (Sent to administrators)', 'Data Removal Request Received', 'Hello&nbsp;{staff_firstname}&nbsp;{staff_lastname}<br /><br />Data removal has been requested by {lead_name}<br /><br />You can review this request and take proper actions directly from the admin area.<br /><br />To view the lead inside the admin area click here:&nbsp;<a href=\'{lead_link}\'>{lead_link}</a>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (69, 'client', 'client-registration-confirmed', 'english', 'Customer Registration Confirmed', 'Your registration is confirmed', '<p>Dear {contact_firstname} {contact_lastname}<br /><br />We just wanted to let you know that your registration at&nbsp;{companyname} is successfully confirmed and your account is now active.<br /><br />You can login at&nbsp;<a href=\'{crm_url}\'>{crm_url}</a> with the email and password you provided during registration.<br /><br />Please contact us if you need any help.<br /><br />Kind Regards, <br />{email_signature}</p>\r\n<p><br />(This is an automated email, so please don\'t reply to this email address)</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (70, 'contract', 'contract-signed-to-staff', 'english', 'Contract Signed (Sent to Staff)', 'Customer Signed a Contract', 'Hi {staff_firstname}<br /><br />A contract with subject&nbsp;<strong>{contract_subject} </strong>has been successfully signed by the customer.<br /><br />You can view the contract at the following link: <a href=\'{contract_link}\'>{contract_subject}</a>&nbsp;or from the admin area.<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (71, 'subscriptions', 'customer-subscribed-to-staff', 'english', 'Customer Subscribed to a Subscription (Sent to administrators and subscription creator)', 'Customer Subscribed to a Subscription', 'The customer <strong>{client_company}</strong> subscribed to a subscription with name&nbsp;<strong>{subscription_name}</strong><br /><br /><strong>ID</strong>:&nbsp;{subscription_id}<br /><strong>Subscription name</strong>:&nbsp;{subscription_name}<br /><strong>Subscription description</strong>:&nbsp;{subscription_description}<br /><br />You can view the subscription by clicking <a href=\'{subscription_link}\'>here</a><br />\r\n<div style=\'text-align: center;\'><span style=\'font-size: 10pt;\'>&nbsp;</span></div>\r\nBest Regards,<br />{email_signature}<br /><br /><span style=\'font-size: 10pt;\'><span style=\'color: 999999;\'>You are receiving this email because you are either administrator or you are creator of the subscription.</span></span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (72, 'client', 'contact-verification-email', 'english', 'Email Verification (Sent to Contact After Registration)', 'Verify Email Address', '<p>Hello&nbsp;{contact_firstname}<br /><br />Please click the button below to verify your email address.<br /><br /><a href=\'{email_verification_url}\'>Verify Email Address</a><br /><br />If you did not create an account, no further action is required</p>\r\n<p><br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (73, 'client', 'new-customer-profile-file-uploaded-to-staff', 'english', 'New Customer Profile File(s) Uploaded (Sent to Staff)', 'Customer Uploaded New File(s) in Profile', 'Hi!<br /><br />New file(s) is uploaded into the customer ({client_company}) profile by&nbsp;{contact_firstname}<br /><br />You can check the uploaded files into the admin area by clicking <a href=\'{customer_profile_files_admin_link}\'>here</a> or at the following link:&nbsp;{customer_profile_files_admin_link}<br /><br />{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (74, 'staff', 'event-notification-to-staff', 'english', 'Event Notification (Calendar)', 'Upcoming Event - :event_title', 'Hi {staff_firstname}! <br /><br />This is a reminder for event <a href=\'{event_link}\'>{event_title}</a> scheduled at {event_start_date}. <br /><br />Regards.', '', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (75, 'subscriptions', 'subscription-payment-requires-action', 'english', 'Credit Card Authorization Required - SCA', 'Important: Confirm your subscription {subscription_name} payment', '<p>Hello {contact_firstname}</p>\r\n<p><strong>Your bank sometimes requires an additional step to make sure an online transaction was authorized.</strong><br /><br />Because of European regulation to protect consumers, many online payments now require two-factor authentication. Your bank ultimately decides when authentication is required to confirm a payment, but you may notice this step when you start paying for a service or when the cost changes.<br /><br />In order to pay the subscription <strong>{subscription_name}</strong>, you will need to&nbsp;confirm your payment by clicking on the follow link: <strong><a href=\'{subscription_authorize_payment_link}\'>{subscription_authorize_payment_link}</a></strong><br /><br />To view the subscription, please click at the following link: <a href=\'{subscription_link}\'><span>{subscription_link}</span></a><br />or you can login in our dedicated area here: <a href=\'{crm_url}/login\'>{crm_url}/login</a> in case you want to update your credit card or view the subscriptions you are subscribed.<br /><br />Best Regards,<br />{email_signature}</p>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (76, 'invoice', 'invoice-due-notice', 'english', 'Invoice Due Notice', 'Your {invoice_number} will be due soon', '<span style=\'font-size: 12pt;\'>Hi {contact_firstname} {contact_lastname}<br /><br /></span>You invoice <span style=\'font-size: 12pt;\'><strong> {invoice_number} </strong>will be due on <strong>{invoice_duedate}</strong></span><br /><br /><span style=\'font-size: 12pt;\'>You can view the invoice on the following link: <a href=\'{invoice_link}\'>{invoice_number}</a></span><br /><br /><span style=\'font-size: 12pt;\'>Kind Regards,</span><br /><span style=\'font-size: 12pt;\'>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (77, 'estimate_request', 'estimate-request-submitted-to-staff', 'english', 'Estimate Request Submitted (Sent to Staff)', 'New Estimate Request Submitted', '<span> Hello,&nbsp;</span><br /><br />{estimate_request_email} submitted an estimate request via the {estimate_request_form_name} form.<br /><br />You can view the request at the following link: <a href=\'{estimate_request_link}\'>{estimate_request_link}</a><br /><br />==<br /><br />{estimate_request_submitted_data}<br /><br />Kind Regards,<br /><span>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (78, 'estimate_request', 'estimate-request-assigned', 'english', 'Estimate Request Assigned (Sent to Staff)', 'New Estimate Request Assigned', '<span> Hello {estimate_request_assigned},&nbsp;</span><br /><br />Estimate request {estimate_request_id} has been assigned to you.<br /><br />You can view the request at the following link: <a href=\'{estimate_request_link}\'>{estimate_request_link}</a><br /><br />Kind Regards,<br /><span>{email_signature}</span>', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (79, 'estimate_request', 'estimate-request-received-to-user', 'english', 'Estimate Request Received (Sent to User)', 'Estimate Request Received', 'Hello,<br /><br /><strong>Your request has been received.</strong><br /><br />This email is to let you know that we received your request and we will get back to you as soon as possible with more information.<br /><br />Best Regards,<br />{email_signature}', '{companyname} | CRM', '', 0, 0, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (80, 'notifications', 'non-billed-tasks-reminder', 'english', 'Non-billed tasks reminder (sent to selected staff members)', 'Action required: Completed tasks are not billed', 'Hello {staff_firstname}<br><br>The following tasks are marked as complete but not yet billed:<br><br>{unbilled_tasks_list}<br><br>Kind Regards,<br><br>{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (81, 'invoice', 'invoices-batch-payments', 'english', 'Invoices Payments Recorded in Batch (Sent to Customer)', 'We have received your payments', 'Hello {contact_firstname} {contact_lastname}<br><br>Thank you for the payments. Please find the payments details below:<br><br>{batch_payments_list}<br><br>We are looking forward working with you.<br><br>Kind Regards,<br><br>{email_signature}', '{companyname} | CRM', '', 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (82, 'purchase_order', 'purchase-order-to-contact', 'english', 'Purchase Order (Sent to contact)', 'Purchase Order', '<span style=\'font-size: 12pt;\'> Hello !. </span><br /><br /><span style=\'font-size: 12pt;\'> We would like to share with you a link of Purchase Order information with the number {po_number} </span><br /><br /><span style=\'font-size: 12pt;\'><br />Please click on the link to view information: {public_link}\r\n  </span><br /><br />', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (83, 'purchase_order', 'purchase-request-to-contact', 'english', 'Purchase Request (Sent to contact)', 'Purchase Request', '<span style=\'font-size: 12pt;\'> Hello !. </span><br /><br /><span style=\'font-size: 12pt;\'> We would like to share with you a link of Purchase Request information with the number {pr_number} </span><br /><br /><span style=\'font-size: 12pt;\'><br />Please click on the link to view information: {public_link}<br/ >{additional_content}\r\n  </span><br /><br />', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (84, 'purchase_order', 'purchase-quotation-to-contact', 'english', 'Purchase Quotation (Sent to contact)', 'Purchase Quotation', '<span style=\'font-size: 12pt;\'> Hello !. </span><br /><br /><span style=\'font-size: 12pt;\'> We would like to share with you a link of Purchase Quotation information with the number {pq_number} </span><br /><br /><span style=\'font-size: 12pt;\'><br />Please click on the link to view information: {quotation_link}<br/ >{additional_content}\r\n  </span><br /><br />', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (85, 'purchase_order', 'debit-note-to-contact', 'english', 'Debit Note (Sent to contact)', 'Debit Note', '<span style=\'font-size: 12pt;\'> Hello !. </span><br /><br /><span style=\'font-size: 12pt;\'> We would like to share with you a link of Debit Note information with the number {dn_number} </span><br /><br /><span style=\'font-size: 12pt;\'><br />{additional_content}\r\n  </span><br /><br />', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (86, 'purchase_order', 'purchase-statement-to-contact', 'english', 'Purchase Statement (Sent to contact)', 'Purchase Statement', '<span style=\'font-size: 12pt;\'> Dear {contact_firstname} {contact_lastname} !. </span><br /><br /><span style=\'font-size: 12pt;\'>Its been a great experience working with you. </span><br /><br /><span style=\'font-size: 12pt;\'><br />Attached with this email is a list of all transactions for the period between {statement_from} to {statement_to}<br/ ><br/ >For your information your account balance due is total: {statement_balance_due}<br /><br/ > Please contact us if you need more information.<br/ > <br />{additional_content}\r\n  </span><br /><br />', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (87, 'client', 'new-client-created', 'bulgarian', 'New Contact Added/Registered (Welcome Email) [bulgarian]', 'Welcome aboard', '', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (88, 'invoice', 'invoice-send-to-client', 'bulgarian', 'Send Invoice to Customer [bulgarian]', 'Invoice with number {invoice_number} created', '', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
        (89, 'ticket', 'new-ticket-opened-admin', 'bulgarian', 'New Ticket Opened (Opened by Staff, Sent to Customer) [bulgarian]', 'New Support Ticket Opened', '', '{companyname} | CRM', NULL, 0, 1, 0,'2022-12-19 20:30:52','2022-12-19 20:30:52'),
