        DB::statement("INSERT INTO tbl_get_account_type_details VALUES(1, 1, 'Accounts Receivable (A/R)', 'Accounts receivable (also called A/R, Debtors, or Trade and other receivables) tracks money that customers owe you for products or services, and payments customers make.\r\n\r\nEach customer has a register, which functions like an Accounts receivable account ', 1),
        (2, 2, 'Allowance for bad debts', 'Use Allowance for bad debts to estimate the part of Accounts Receivable that you think you might not collect.\r\nUse this only if you are keeping your books on the accrual basis.', 2),
        (3, 2, 'Assets available for sale', 'Use Assets available for sale to track assets that are available for sale that are not expected to be held for a long period of time.', 3),
        (4, 2, 'Development Costs', 'Use Development costs to track amounts you deposit or set aside to arrange for financing, such as an SBA loan, or for deposits in anticipation of the purchase of property or other assets.\r\nWhen the deposit is refunded, or the purchase takes place, remove ', 4),
        (5, 2, 'Inventory', 'Use Inventory to track the cost of goods your business purchases for resale.\r\nWhen the goods are sold, assign the sale to a Cost of sales account.', 5),
        (6, 2, 'Investments - Other', 'Use Investments - Other to track the value of investments not covered by other investment account types. Examples include publicly-traded shares, coins, or gold.', 6),
        (7, 2, 'Loans To Officers', 'If you operate your business as a Corporation, use Loans to officers to track money loaned to officers of your business.', 7),
        (8, 2, 'Loans To Others', 'Use Loans to others to track money your business loans to other people or businesses.\r\nThis type of account is also referred to as Notes Receivable.\r\n\r\nFor early salary payments to employees, use Employee cash advances, instead.', 8),
        (9, 2, 'Loans To Shareholders', 'If you operate your business as a Corporation, use Loans to Shareholders to track money your business loans to its shareholders.', 9),
        (10, 2, 'Other current assets', 'Use Other current assets for current assets not covered by the other types. Current assets are likely to be converted to cash or used up in a year.', 10),
        (11, 2, 'Prepaid Expenses', 'Use Prepaid expenses to track payments for expenses that you won’t recognise until your next accounting period.\r\nWhen you recognise the expense, make a journal entry to transfer money from this account to the expense account.', 11),
        (12, 2, 'Retainage', 'Use Retainage if your customers regularly hold back a portion of a contract amount until you have completed a project.\r\nThis type of account is often used in the construction industry, and only if you record income on an accrual basis.', 12),
        (13, 2, 'Undeposited Funds', 'Use Undeposited funds for cash or cheques from sales that haven’t been deposited yet.\r\nFor petty cash, use Cash on hand, instead.', 13),
        (14, 3, 'Bank', 'Use Bank accounts to track all your current activity, including debit card transactions.', 14),
        (15, 3, 'Cash and cash equivalents', 'Use Cash and Cash Equivalents to track cash or assets that can be converted into cash immediately. For example, marketable securities and Treasury bills.', 15),
        (16, 3, 'Cash on hand', 'Use a Cash on hand account to track cash your company keeps for occasional expenses, also called petty cash.\r\nTo track cash from sales that have not been deposited yet, use a pre-created account called Undeposited funds, instead.', 16),
        (17, 3, 'Client trust account', 'Use Client trust accounts for money held by you for the benefit of someone else.\r\nFor example, trust accounts are often used by attorneys to keep track of expense money their customers have given them.\r\n\r\nOften, to keep the amount in a trust account from ', 17),
        (18, 3, 'Money Market', 'Use Money market to track amounts in money market accounts.\r\nFor investments, see Current Assets, instead.', 18),
        (19, 3, 'Rents Held in Trust', 'Use Rents held in trust to track deposits and rent held on behalf of the property owners.\r\nTypically only property managers use this type of account.', 19),
        (20, 3, 'Savings', 'Use Savings accounts to track your savings and CD activity.\r\nEach savings account your company has at a bank or other financial institution should have its own Savings type account.\r\n\r\nFor investments, see Current Assets, instead.', 20),
        (21, 4, 'Accumulated depletion', 'Use Accumulated depletion to track how much you deplete a natural resource.', 21),
        (22, 4, 'Accumulated depreciation on property, plant and equipment', 'Use Accumulated depreciation on property, plant and equipment to track how much you depreciate a fixed asset (a physical asset you do not expect to convert to cash during one year of normal operations).', 22),
        (23, 4, 'Buildings', 'Use Buildings to track the cost of structures you own and use for your business. If you have a business in your home, consult your accountant.\r\nUse a Land account for the land portion of any real property you own, splitting the cost of the property betwee', 23),
        (24, 4, 'Depletable Assets', 'Use Depletable assets to track natural resources, such as timberlands, oil wells, and mineral deposits.', 24),
        (25, 4, 'Furniture and Fixtures', 'Use Furniture and fixtures to track any furniture and fixtures your business owns and uses, like a dental chair or sales booth.', 25),
        (26, 4, 'Land', 'Use Land to track assets that are not easily convertible to cash or not expected to become cash within the next year. For example, leasehold improvements.', 26),
        (27, 4, 'Leasehold Improvements', 'Use Leasehold improvements to track improvements to a leased asset that increases the asset’s value. For example, if you carpet a leased office space and are not reimbursed, that’s a leasehold improvement.', 27),
        (28, 4, 'Machinery and equipment', 'Use Machinery and equipment to track computer hardware, as well as any other non-furniture fixtures or devices owned and used for your business.\r\nThis includes equipment that you ride, like tractors and lawn mowers. Cars and lorries, however, should be tr', 28),
        (29, 4, 'Other fixed assets', 'Use Other fixed asset for fixed assets that are not covered by other asset types.\r\nFixed assets are physical property that you use in your business and that you do not expect to convert to cash or be used up during one year of normal operations.', 29),
        (30, 4, 'Vehicles', 'Use Vehicles to track the value of vehicles your business owns and uses for business. This includes off-road vehicles, air planes, helicopters, and boats.\r\nIf you use a vehicle for both business and personal use, consult your accountant to see how you sho', 30),
        (31, 5, 'Accumulated amortisation of non-current assets', 'Use Accumulated amortisation of non-current assets to track how much you’ve amortised an asset whose type is Non-Current Asset.', 31),
        (32, 5, 'Assets held for sale', 'Use Assets held for sale to track assets of a company that are available for sale that are not expected to be held for a long period of time.', 32),
        (33, 5, 'Deferred tax', 'Use Deferred tax for tax liabilities or assets that are to be used in future accounting periods.', 33),
        (34, 5, 'Goodwill', 'Use Goodwill only if you have acquired another company. It represents the intangible assets of the acquired company which gave it an advantage, such as favourable government relations, business name, outstanding credit ratings, location, superior manageme', 34),
        (35, 5, 'Intangible Assets', 'Use Intangible assets to track intangible assets that you plan to amortise. Examples include franchises, customer lists, copyrights, and patents.', 35),
        (36, 5, 'Lease Buyout', 'Use Lease buyout to track lease payments to be applied toward the purchase of a leased asset.\r\nYou don’t track the leased asset itself until you purchase it.', 36),
        (37, 5, 'Licences', 'Use Licences to track non-professional licences for permission to engage in an activity, like selling alcohol or radio broadcasting.\r\nFor fees associated with professional licences granted to individuals, use a Legal and professional fees expense account,', 37),
        (38, 5, 'Long-term investments', 'Use Long-term investments to track investments that have a maturity date of longer than one year.', 38),
        (39, 5, 'Organisational Costs', 'Use Organisational costs to track costs incurred when forming a partnership or corporation.\r\nThe costs include the legal and accounting costs necessary to organise the company, facilitate the filings of the legal documents, and other paperwork.', 39),
        (40, 5, 'Other non-current assets', 'Use Other non-current assets to track assets not covered by other types.\r\nNon-current assets are long-term assets that are expected to provide value for more than one year.', 40),
        (41, 5, 'Security Deposits', 'Use Security deposits to track funds you’ve paid to cover any potential costs incurred by damage, loss, or theft.\r\nThe funds should be returned to you at the end of the contract.\r\n\r\nIf you accept down payments, advance payments, security deposits, or othe', 41),
        (42, 6, 'Accounts Payable (A/P)', 'Accounts payable (also called A/P, Trade and other payables, or Creditors) tracks amounts you owe to your suppliers.', 42),
        (43, 7, 'Credit Card', 'Credit card accounts track the balance due on your business credit cards.\r\nCreate one Credit card account for each credit card account your business uses.', 43),
        (44, 8, 'Accrued liabilities', 'Use Accrued Liabilities to track expenses that a business has incurred but has not yet paid. For example, pensions for companies that contribute to a pension fund for their employees for their retirement.', 44),
        (45, 8, 'Client Trust Accounts - Liabilities', 'Use Client Trust accounts - liabilities to offset Client Trust accounts in assets.\r\nAmounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This ', 45),
        (46, 8, 'Current Tax Liability', 'Use Current tax liability to track the total amount of taxes collected but not yet paid to the government.', 46),
        (47, 8, 'Current portion of obligations under finance leases', 'Use Current portion of obligations under finance leases to track the value of lease payments due within the next 12 months.', 47),
        (48, 8, 'Dividends payable', 'Use Dividends payable to track dividends that are owed to shareholders but have not yet been paid.', 48),
        (50, 8, 'Income tax payable', 'Use Income tax payable to track monies that are due to pay the company’s income tax liabilties.', 50),
        (51, 8, 'Insurance payable', 'Use Insurance payable to keep track of insurance amounts due.\r\nThis account is most useful for businesses with monthly recurring insurance expenses.', 51),
        (52, 8, 'Line of Credit', 'Use Line of credit to track the balance due on any lines of credit your business has. Each line of credit your business has should have its own Line of credit account.', 52),
        (53, 8, 'Loan Payable', 'Use Loan payable to track loans your business owes which are payable within the next twelve months.\r\nFor longer-term loans, use the Long-term liability called Notes payable, instead.', 53),
        (54, 8, 'Other current liabilities', 'Use Other current liabilities to track monies owed by the company and due within one year.', 54),
        (55, 8, 'Payroll Clearing', 'Use Payroll clearing to keep track of any non-tax amounts that you have deducted from employee paycheques or that you owe as a result of doing payroll. When you forward money to the appropriate suppliers, deduct the amount from the balance of this account', 55),
        (56, 8, 'Payroll liabilities', 'Use Payroll liabilities to keep track of tax amounts that you owe to government agencies as a result of paying wages. This includes taxes withheld, health care premiums, employment insurance, government pensions, etc. When you forward the money to the gov', 56),
        (58, 8, 'Prepaid Expenses Payable', 'Use Prepaid expenses payable to track items such as property taxes that are due, but not yet deductible as an expense because the period they cover has not yet passed.', 58),
        (59, 8, 'Rents in trust - Liability', 'Use Rents in trust - liability to offset the Rents in trust amount in assets.\r\nAmounts in these accounts are held by your business on behalf of others. They do not belong to your business, so should not appear to be yours on your balance sheet. This &quot', 59),
        (60, 8, 'Sales and service tax payable', 'Use Sales and service tax payable to track tax you have collected, but not yet remitted to your government tax agency. This includes value-added tax, goods and services tax, sales tax, and other consumption tax.', 60),
        (61, 9, 'Accrued holiday payable', 'Use Accrued holiday payable to track holiday earned but that has not been paid out to employees.', 61),
        (62, 9, 'Accrued non-current liabilities', 'Use Accrued Non-current liabilities to track expenses that a business has incurred but has not yet paid. For example, pensions for companies that contribute to a pension fund for their employees for their retirement.', 62),
        (63, 9, 'Liabilities related to assets held for sale', 'Use Liabilities related to assets held for sale to track any liabilities that are directly related to assets being sold or written off.', 63),
        (64, 9, 'Long-term debt', 'Use Long-term debt to track loans and obligations with a maturity of longer than one year. For example, mortgages.', 64),
        (65, 9, 'Notes Payable', 'Use Notes payable to track the amounts your business owes in long-term (over twelve months) loans.\r\nFor shorter loans, use the Current liability account type called Loan payable, instead.', 65),
        (66, 9, 'Other non-current liabilities', 'Use Other non-current liabilities to track liabilities due in more than twelve months that don’t fit the other Non-Current liability account types.', 66),
        (67, 9, 'Shareholder Notes Payable', 'Use Shareholder notes payable to track long-term loan balances your business owes its shareholders.', 67),
        (68, 10, 'Accumulated adjustment', 'Some corporations use this account to track adjustments to owner’s equity that are not attributable to net income.', 68),
        (69, 10, 'Dividend disbursed', 'Use Dividend disbursed to track a payment given to its shareholders out of the company’s retained earnings.', 69),
        (70, 10, 'Equity in earnings of subsidiaries', 'Use Equity in earnings of subsidiaries to track the original investment in shares of subsidiaries plus the share of earnings or losses from the operations of the subsidiary.', 70),
        (71, 10, 'Opening Balance Equity', 'As you enter opening balances, System records the amounts in Opening balance equity. This ensures that you have a correct balance sheet for your company, even before you’ve finished entering all your company’s assets and liabilities.', 71),
        (72, 10, 'Ordinary shares', 'Corporations use Ordinary shares to track its ordinary shares in the hands of shareholders. The amount in this account should be the stated (or par) value of the stock.', 72),
        (73, 10, 'Other comprehensive income', 'Use Other comprehensive income to track the increases or decreases in income from various businesses that is not yet absorbed by the company.', 73),
        (74, 10, 'Owner\'s Equity', 'Corporations use Owner’s equity to show the cumulative net income or loss of their business as of the beginning of the financial year.', 74),
        (75, 10, 'Paid-in capital or surplus', 'Corporations use Paid-in capital to track amounts received from shareholders in exchange for shares that are over and above the shares’ stated (or par) value.', 75),
        (76, 10, 'Partner Contributions', 'Partnerships use Partner contributions to track amounts partners contribute to the partnership during the year.', 76),
        (77, 10, 'Partner Distributions', 'Partnerships use Partner distributions to track amounts distributed by the partnership to its partners during the year.\r\nDon’t use this for regular payments to partners for interest or service. For regular payments, use a Guaranteed payments account (a Ex', 77),
        (78, 10, 'Partner\'s Equity', 'Partnerships use Partner’s equity to show the income remaining in the partnership for each partner as of the end of the prior year.', 78),
        (79, 10, 'Preferred shares', 'Corporations use this account to track its preferred shares in the hands of shareholders. The amount in this account should be the stated (or par) value of the shares.', 79),
        (80, 10, 'Retained Earnings', 'Retained earnings tracks net income from previous financial years.', 80),
        (81, 10, 'Share capital', 'Use Share capital to track the funds raised by issuing shares.', 81),
        (82, 10, 'Treasury Shares', 'Corporations use Treasury shares to track amounts paid by the corporation to buy its own shares back from shareholders.', 82),
        (83, 11, 'Discounts/Refunds Given', 'Use Discounts/refunds given to track discounts you give to customers.\r\nThis account typically has a negative balance so it offsets other income.\r\n\r\nFor discounts from suppliers, use an expense account, instead.', 83),
        (84, 11, 'Non-Profit Income', 'Use Non-profit income to track money coming in if you are a non-profit organisation.', 84),
        (85, 11, 'Other Primary Income', 'Use Other primary income to track income from normal business operations that doesn’t fall into another Income type.', 85),
        (86, 11, 'Revenue - General', 'Use Revenue - General to track income from normal business operations that do not fit under any other category.', 86),
        (87, 11, 'Sales - retail', 'Use Sales - retail to track sales of goods/services that have a mark-up cost to consumers.', 87),
        (88, 11, 'Sales - wholesale', 'Use Sales - wholesale to track the sale of goods in quantity for resale purposes.', 88),
        (89, 11, 'Sales of Product Income', 'Use Sales of product income to track income from selling products.\r\nThis can include all kinds of products, like crops and livestock, rental fees, performances, and food served.', 89),
        (90, 11, 'Service/Fee Income', 'Use Service/fee income to track income from services you perform or ordinary usage fees you charge.\r\nFor fees customers pay you for late payments or other uncommon situations, use an Other Income account type called Other miscellaneous income, instead.', 90),
        (91, 11, 'Unapplied Cash Payment Income', 'Unapplied Cash Payment Income reports the Cash Basis income from customers payments you’ve received but not applied to invoices or charges. In general, you would never use this directly on a purchase or sale transaction.', 91),
        (92, 12, 'Dividend income', 'Use Dividend income to track taxable dividends from investments.', 92),
        (93, 12, 'Interest earned', 'Use Interest earned to track interest from bank or savings accounts, investments, or interest payments to you on loans your business made.', 93),
        (94, 12, 'Loss on disposal of assets', 'Use Loss on disposal of assets to track losses realised on the disposal of assets.', 94),
        (95, 12, 'Other Investment Income', 'Use Other investment income to track other types of investment income that isn’t from dividends or interest.', 95),
        (96, 12, 'Other Miscellaneous Income', 'Use Other miscellaneous income to track income that isn’t from normal business operations, and doesn’t fall into another Other Income type.', 96),
        (97, 12, 'Other operating income', 'Use Other operating income to track income from activities other than normal business operations. For example, Investment interest, foreign exchange gains, and rent income.', 97),
        (98, 12, 'Tax-Exempt Interest', 'Use Tax-exempt interest to record interest that isn’t taxable, such as interest on money in tax-exempt retirement accounts, or interest from tax-exempt bonds.', 98),
        (99, 12, 'Unrealised loss on securities, net of tax', 'Use Unrealised loss on securities, net of tax to track losses on securities that have occurred but are yet been realised through a transaction. For example, shares whose value has fallen but that are still being held.', 99),
        (100, 13, 'Cost of labour - COS', 'Use Cost of labour - COS to track the cost of paying employees to produce products or supply services.\r\nIt includes all employment costs, including food and transportation, if applicable.', 100),
        (101, 13, 'Equipment rental - COS', 'Use Equipment rental - COS to track the cost of renting equipment to produce products or services.\r\nIf you purchase equipment, use a Fixed Asset account type called Machinery and equipment.', 101),
        (102, 13, 'Freight and delivery - COS', 'Use Freight and delivery - COS to track the cost of shipping/delivery of obtaining raw materials and producing finished goods for resale.', 102),
        (103, 13, 'Other costs of sales - COS', 'Use Other costs of sales - COS to track costs related to services or sales that you provide that don’t fall into another Cost of Sales type.', 103),
        (104, 13, 'Supplies and materials - COS', 'Use Supplies and materials - COS to track the cost of raw goods and parts used or consumed when producing a product or providing a service.', 104),
        (105, 14, 'Advertising/Promotional', 'Use Advertising/promotional to track money spent promoting your company.\r\nYou may want different accounts of this type to track different promotional efforts (Yellow Pages, newspaper, radio, flyers, events, and so on).\r\n\r\nIf the promotion effort is a meal', 105),
        (106, 14, 'Amortisation expense', 'Use Amortisation expense to track writing off of assets (such as intangible assets or investments) over the projected life of the assets.', 106),
        (107, 14, 'Auto', 'Use Auto to track costs associated with vehicles.\r\nYou may want different accounts of this type to track petrol, repairs, and maintenance.\r\n\r\nIf your business owns a car or lorry, you may want to track its value as a Fixed Asset, in addition to tracking i', 107),
        (108, 14, 'Bad debts', 'Use Bad debt to track debt you have written off.', 108),
        (109, 14, 'Bank charges', 'Use Bank charges for any fees you pay to financial institutions.', 109),
        (110, 14, 'Charitable Contributions', 'Use Charitable contributions to track gifts to charity.', 110),
        (111, 14, 'Commissions and fees', 'Use Commissions and fees to track amounts paid to agents (such as brokers) in order for them to execute a trade.', 111),
        (112, 14, 'Cost of Labour', 'Use Cost of labour to track the cost of paying employees to produce products or supply services.\r\nIt includes all employment costs, including food and transportation, if applicable.\r\n\r\nThis account is also available as a Cost of Sales (COS) account.', 112),
        (113, 14, 'Dues and Subscriptions', 'Use Dues and subscriptions to track dues and subscriptions related to running your business.\r\nYou may want different accounts of this type for professional dues, fees for licences that can’t be transferred, magazines, newspapers, industry publications, or', 113),
        (114, 14, 'Equipment rental', 'Use Equipment rental to track the cost of renting equipment to produce products or services.\r\nThis account is also available as a Cost of Sales account.\r\n\r\nIf you purchase equipment, use a Fixed asset account type called Machinery and equipment.', 114),
        (115, 14, 'Finance costs', 'Use Finance costs to track the costs of obtaining loans or credit.\r\nExamples of finance costs would be credit card fees, interest and mortgage costs.', 115),
        (116, 14, 'Income tax expense', 'Use Income tax expense to track income taxes that the company has paid to meet their tax obligations.', 116),
        (117, 14, 'Insurance', 'Use Insurance to track insurance payments.\r\nYou may want different accounts of this type for different types of insurance (auto, general liability, and so on).', 117),
        (118, 14, 'Interest paid', 'Use Interest paid for all types of interest you pay, including mortgage interest, finance charges on credit cards, or interest on loans.', 118),
        (119, 14, 'Legal and professional fees', 'Use Legal and professional fees to track money to pay to professionals to help you run your business.\r\nYou may want different accounts of this type for payments to your accountant, attorney, or other consultants.', 119),
        (120, 14, 'Loss on discontinued operations, net of tax', 'Use Loss on discontinued operations, net of tax to track the loss realised when a part of the business ceases to operate or when a product line is discontinued.', 120),
        (121, 14, 'Management compensation', 'Use Management compensation to track remuneration paid to Management, Executives and non-Executives. For example, salary, fees, and benefits.', 121),
        (122, 14, 'Meals and entertainment', 'Use Meals and entertainment to track how much you spend on dining with your employees to promote morale.\r\nIf you dine with a customer to promote your business, use a Promotional meals account, instead.\r\n\r\nBe sure to include who you ate with and the purpos', 122),
        (123, 14, 'Office/General Administrative Expenses', 'Use Office/general administrative expenses to track all types of general or office-related expenses.', 123),
        (124, 14, 'Other Miscellaneous Service Cost', 'Use Other miscellaneous service cost to track costs related to providing services that don’t fall into another Expense type.\r\nThis account is also available as a Cost of Sales (COS) account.', 124),
        (125, 14, 'Other selling expenses', 'Use Other selling expenses to track selling expenses incurred that do not fall under any other category.', 125),
        (126, 14, 'Payroll Expenses', 'Use Payroll expenses to track payroll expenses. You may want different accounts of this type for things like:\r\n- Compensation of officers\r\n- Guaranteed payments\r\n- Workers compensation\r\n- Salaries and wages\r\n- Payroll taxes', 126),
        (127, 14, 'Rent or Lease of Buildings', 'Use Rent or lease of buildings to track rent payments you make.', 127),
        (128, 14, 'Repair and maintenance', 'Use Repair and maintenance to track any repairs and periodic maintenance fees.\r\nYou may want different accounts of this type to track different types repair & maintenance expenses (auto, equipment, landscape, and so on).', 128),
        (129, 14, 'Shipping and delivery expense', 'Use Shipping and delivery expense to track the cost of shipping and delivery of goods to customers.', 129),
        (130, 14, 'Supplies and materials', 'Use Supplies & materials to track the cost of raw goods and parts used or consumed when producing a product or providing a service.\r\nThis account is also available as a Cost of Sales account.', 130),
        (131, 14, 'Taxes Paid', 'Use Taxes paid to track taxes you pay.\r\nYou may want different accounts of this type for payments to different tax agencies.', 131),
        (132, 14, 'Travel expenses - general and admin expenses', 'Use Travel expenses - general and admin expenses to track travelling costs incurred that are not directly related to the revenue-generating operation of the company. For example, flight tickets and hotel costs when performing job interviews.', 132),
        (133, 14, 'Travel expenses - selling expense', 'Use Travel expenses - selling expense to track travelling costs incurred that are directly related to the revenue-generating operation of the company. For example, flight tickets and hotel costs when selling products and services.', 133),
        (134, 14, 'Unapplied Cash Bill Payment Expense', 'Unapplied Cash Bill Payment Expense reports the Cash Basis expense from supplier payment cheques you’ve sent but not yet applied to supplier bills. In general, you would never use this directly on a purchase or sale transaction.', 134),
        (135, 14, 'Utilities', 'Use Utilities to track utility payments.\r\nYou may want different accounts of this type to track different types of utility payments (gas and electric, telephone, water, and so on).', 135),
        (136, 15, 'Amortisation', 'Use Amortisation to track amortisation of intangible assets.\r\nAmortisation is spreading the cost of an intangible asset over its useful life, like depreciation of fixed assets.\r\n\r\nYou may want an amortisation account for each intangible asset you have.', 136),
        (137, 15, 'Depreciation', 'Use Depreciation to track how much you depreciate fixed assets.\r\nYou may want a depreciation account for each fixed asset you have.', 137),
        (138, 15, 'Exchange Gain or Loss', 'Use Exchange Gain or Loss to track gains or losses that occur as a result of exchange rate fluctuations.', 138),
        (139, 15, 'Other Expense', 'Use Other expense to track unusual or infrequent expenses that don’t fall into another Other Expense type.', 139),
        (140, 15, 'Penalties and settlements', 'Use Penalties and settlements to track money you pay for violating laws or regulations, settling lawsuits, or other penalties.', 140),
        (141, 2, 'Employee Cash Advances', 'Use Employee cash advances to track employee wages and salary you issue to an employee early, or other non-salary money given to employees.\r\nIf you make a loan to an employee, use the Current asset account type called Loans to others, instead.', 5)");
        

