r experts.&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Rates are valid only for Indian Nationals, for any other nationality, please speak to our tour experts.&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Rates are valid only for Indian Nationals, for any other nationality, please speak to our tour experts.&lt;/li&gt;&lt;li&gt;Rates are valid only for Indian Nationals, for any other nationality, please speak to our tour experts.&lt;/li&gt;&lt;/ul&gt;', '																																																																						&lt;ul&gt;&lt;li&gt;&lt;/li&gt;&lt;li&gt;The Company is under no obligation to furnish a breakdown of the costs involved in a holiday.&lt;/li&gt;&lt;li&gt;After a Confirmation Invoice has been issued, unless you choose to pay for your holiday in full at the time of booking, the price of your holiday is subject to the possibilities of surcharges in certain limited circumstances. However, a surcharge will only be levied to allow for variations in transportation cost, including cost of fuel, increase in normal published airfares, taxes or fees chargeable for services such as landing taxes at airports, the exchange rate applied to the particular package or if the government or regulatory body introduce an increase of taxes. Even then, the Company will absorb an amount equal to 2% of your holiday price (excluding insurance premiums and amendment charges) before passing on any surcharge to you. Only amounts in excess of this 2% will be surcharged. Surcharges will be notified by a revised Confirmation Invoice sent to you.&lt;/li&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do edfiusmod tempor incididunt ut&lt;/li&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;li&gt;&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;', '', '																																																																																																																					&lt;ul&gt;&lt;li&gt; The itinerary may be modified based on various factors like maintenance of historical monuments, museums, major events like sports conventions, religious festivals, etc. Musafir.com reserves the right to change the departure date or cancel a departure due to unforeseen reasons and will not take any responsibility for any ticket of the customer which they may have purchased in advance for sector within India or abroad.&lt;/li&gt;&lt;li&gt; Individuals are responsible for the adherence of time at all stages of the tour. In the event that a customer misses on any part of the sightseeing tour or any such tour due to delay on his part, he will not be entitled to claim refund of the same.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut&lt;/li&gt;&lt;/ul&gt;&lt;hr&gt;&lt;ul&gt;&lt;li&gt;&lt;br&gt;&lt;/li&gt;&lt;/ul&gt;', '', '&lt;p&gt; roots in a piece of classical Latin literature from 45 BC, mak