melled and when nothing prevents\';}i:4;a:1:{s:5:\'terms\';s:114:\'to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated\';}}', 'a:3:{s:7:\'heading\';s:0:\'\';i:0;a:2:{s:12:\'amend_policy\';s:23:\'Changing departure date\';s:18:\'amend_policy_right\';s:34:\' Changing pick up time or location\';}i:1;a:2:{s:12:\'amend_policy\';s:13:\'Changing tour\';s:18:\'amend_policy_right\';s:19:\'Changing guest name\';}}', '', '&lt;p&gt;&lt;span style=&quot;font-family: &quot;Verlag A&quot;, &quot;Verlag B&quot;; font-size: 17px; text-align: center; background-color: rgb(254, 246, 235);&quot;&gt;Travel to tropical island havens, hike in the breathtakingly beautiful Swiss mountains and marvel at the starry night sky. Be an explorer on a trip through the endless landscapes of Botswana, spend a night at a luxurious lodge and be woken up by the rising sun. Forget time, unwind, enjoy authentic, warm hospitality in an exclusive Greek island resort.  Soak up the endless expanse of blue on the high seas. Stand at the prow of an expedition ship, inhale the crystal-clear sea air and listen to the ice break. Dream. Dive head over heels into a pulsating metropolis. Live in the moment. Whatever you are dreaming of, here you will find select offers from the SIGNATURE VOYAGES premium travel portfolio.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'a:4:{i:0;a:1:{s:11:\'hotel_notes\';s:246:\'Permit require for Tsomgo Lake. It is mandatory that guest should carry 04 copies of pass – port size photograph, original photo ID proof with photo copy (identity card – Voter ID card/Pass-port/Driving License etc) for processing the permit.\';}i:1;a:1:{s:11:\'hotel_notes\';s:158:\'Permit also require for traveling to North Sikkim (Lachung & Lachen). Requires 02 more copies of passport size photographs along with original photo ID proof.\';}i:2;a:1:{s:11:\'hotel_notes\';s:118:\'The above mentioned hotels will be confirmed as per the room availability. Otherwise we will confirm similar category.\';}i:3;a:1:{s:11:\'hotel_notes\';s:177:\'The rates quoted in the packages are on per person basis, valid for Indian nationals & till 15th Sep 2014 (High seasons surcharge will be applicable from 20TH Dec – 04TH Jan).\';}}', 'a:1:{i:0;a:1:{s:11:\'rates_notes\';s:0:\'\';}}', 'a:5:{i:0;a:1:{s:9:\'hotel_exc\';s:22:\'Air Fare / Train fare.\';}i:1;a:1:{s:9:\'hotel_exc\';s:173:\'Personal expenses such as laundry, telephone calls, tips & gratuity, mineral water, soft & hard drinks, rafting, rock climbing, paragliding, joy ride (Toy Train), porterage.\';}i:2;a:1:{s:9:\'hotel_exc\';s:88:\'Additional sightseeing or extra usage of vehicle, other than mentioned in the itinerary.\';}i:3;a:1:{s:9:\'hotel_exc\';s:29:\'Entrance Fees & Guide charges\';}i:4;a:1:{s:9:\'hotel_exc\';s:181:\'Any cost arising due to natural calamities like, landslides, road blockage, political disturbances (strikes), etc (to be borne by the client, which is directly payable on the spot).\';}}', 'Hotel Terms You will find below the package that we propose for your unique vacation experience. Based on the preferences that you have highlighted to us previously, we feel that this plan would be the best arrangement. However, if there are further changes that you would like to add, we will be happy to amend it. Trackitinerary has enjoyed helping thousands of people experience amazing holidays, and we aim to do the same for you. Here’s to an unforgettable trip ahead!', 'a:3:{s:7:\'heading\';s:0:\'\';i:0;a:2:{s:10:\'pay_policy\';s:31:\'1 – 60 days prior to arrival	\';s:16:\'pay_policy_right\';s:8:\'100% Pay\';}i:1;a:2:{s:10:\'pay_policy\';s:31:\'61 – 90 days prior to arrival\';s:16:\'pay_policy_right\';s:12:\'100% Payable\';}}', 'a:1:{i:0;a:1:{s:11:\'benefit_inc\';s:7:\'safsadf\';}}', 'a:3:{i:0;a:1:{s:9:\'hotel_inc\';s:28:\'Hotel Terms Hotel Inclusions\';}i:1;a:1:{s:9:\'hotel_inc\';s:31:\'Hotel Terms Hotel Inclusions 00\';}i:2;a:1:{s:9:\'hotel_inc\';s:31:\'Hotel Terms Hotel Inclusions 88\';}}', '2023-03-30 13:30:29'),
        (3, 'cab', 'a:2:{s:7:\'heading\';s:0:\'\';i:0;a:1:{s:5:\'terms\';s:0:\'\';}}', 'a:2:{s:7:\'heading\';s:0:\'\';i:0;a:2:{s:12:\'cancel_terms\';s:0:\'\';s:18:\'cancel_terms_right\';s:0:\'\';}}', 'a:2:{s:7:\'heading\';s:0:\'\';i:0;a:1:{s:5:\'terms\';s:0:\'\';}}', 'a:4:{s:7:\'heading\';s:31:\'Holiday Package booking process\';s:11:\'sub_heading\';s:58:\'For booking confirmation, Please follow the below process:\';i:0;a:2:{s:16:\'hotel_book_terms\';s:96:\'If travel date is more than 90 days then 50% amount is to be collected within 30 days of booking\';s:22:\'hotel_book_terms_right\';s:97:\'At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum \';}i:1;a:2:{s:16:\'hotel_book_terms\';s:106:\'If travel date is less than 90 days then 50% of package cost is to be collected within 15 days of booking.\';s:22:\'hotel_book_terms_right\';s:82:\'laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio.\';}}', 'a:7:{s:7:\'heading\';s:48:\'Package can be booked using any of below methods\';i:0;a:1:{s:5:\'terms\';s:85:\'At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium\';}i:1;a:1:{s:5:\'terms\';s:109:\'On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized\';}i:2;a:1:{s:5:\'terms\';s:80:\'pleasure of the moment, so blinded by desire, that they cannot foresee the pain \';}i:3;a:1:{s:5:\'terms\';s:82:\'In a free hour, when our power of choice is untrammelled and when nothing prevents\';}i:4;a:1:{s:5:\'terms\';s:114:\'to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated\';}i:5;a:1:{s:5:\'terms\';s:114:\'to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated\';}}', 'a:2:{s:7:\'heading\';s:0:\'\';i:0;a:2:{s:12:\'amend_policy\';s:0:\'\';s:18:\'amend_policy_right\';s:0:\'\';}}', '', '', 'a:1:{i:0;a:1:{s:11:\'hotel_notes\';s:0:\'\';}}', 'a:1:{i:0;a:1:{s:11:\'rates_notes\';s:0:\'\';}}', 'a:1:{i:0;a:1:{s:9:\'hotel_exc\';s:0:\'\';}}', 'But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\'', 'a:2:{s:7:\'heading\';s:0:\'\';i:0;a:2:{s:10:\'pay_policy\';s:0:\'\';s:16:\'pay_policy_right\';s:0:\'\';}}', 'a:1:{i:0;a:1:{s:11:\'benefit_inc\';s:0:\'\';}}', 'a:1:{i:0;a:1:{s:9:\'hotel_inc\';s:0:\'\';}}', '2022-10-20 18:56:54');");
        
